__NUXT_JSONP__("/drugs/Dienogest", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"65928-58-7",chebiId:"",chemicalFormula:"C20H25NO2",definition:"An orally-active, semisynthetic, fourth generation, nonethinylated progestogen with antiproliferative, antiandrogenic, anti-inflammatory and antiangiogenic activities that is used in hormone therapy and as a female contraceptive. Upon oral administration, dienogest binds intracellular progesterone receptors which then translocate to the nucleus where the drug-receptor complex interacts with progesterone response elements, thus altering the expression of target genes. Dienogest reduces the production of estradiol, prevents ovulation and alters the cervical mucus and endometrium. In addition, dienogest appears to suppress the expression of cell cycle regulator cyclin D1. Altogether, this may prevent the growth of endometrial epithelial cells and may reduce symptoms associated with leiomyoma.",fdaUniiCode:"46M3EV8HHE",identifier:"C87238",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C776"],synonyms:["17-Hydroxy-3-Oxo-19-Nor-17Alpha-Pregna-4,9-Diene-21-Nitrile","19-Norpregna-4,9-Diene-21-Nitrile, 17-Hydroxy-3-Oxo-, (17Alpha)-","DIENOGEST",a,"M 18575","MJR-35","STS 557","ZK 37659"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FDienogest",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Dienogest","2021-10-30T13:46:36.723Z")));